import React from 'react';
import { Container } from 'react-bootstrap';
import Navbar from 'react-bootstrap/esm/Navbar';
import { HashRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import ProductListingPage from './ui/page/ProductListingPage';
import ProductDetailPage from './ui/page/ProductListingPage/ProductDetailPage';

function App() {
  return (
    <div className="App">
      <Navbar bg="light" expand="lg">
        <Container><Navbar.Brand href="#home">Ventail</Navbar.Brand>
        </Container>
      </Navbar>
      {/* for seo purpose /detail/:productName/:productId */}
      <HashRouter>
        <Switch>
          <Route exact path="/">
            <ProductListingPage />
          </Route>
          <Route exact path="/detail/:productId"> 
            <ProductDetailPage />
          </Route>
        </Switch>
      </HashRouter>
    </div>
  );
}

export default App;
